import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Navbar from "./components/Navbar";
import Home from "./pages/Home";
import Credentials from "./pages/Credentials";
import Recipe from "./pages/Recipe";
import RecipeDetails from "./pages/RecipeDetails";
import Profile from "./pages/Profile";
import Comments from "./pages/Comments";
import Ratings from "./pages/Ratings";
import RecipeList from "./pages/RecipeList";
import NotFound from "./pages/NotFound";
import './App.css';

const App = () => {
  const [recipes, setRecipes] = useState([
    {
      


    }
  ]);

  useEffect(() => {
    axios.get('https://localhost:3001/recipe') 
      .then(response => {
        setRecipes(response.data);
      })
      .catch(error => {
        console.error('Error fetching recipes:', error);
      });
  }, []);

  return (
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Route exact path="/" element={<Home />} />
        <Route exact path="/credentials" element={<Credentials />} />
        <Route exact path="/recipes" element={<RecipeList recipes={recipes} />} />
        <Route exact path="/recipes/:id" element={<RecipeDetails recipes={recipes} />} />
        <Route exact path="/profile" element={<Profile />} />
        <Route exact path="/comments" element={<Comments />} />
        <Route exact path="/ratings" element={<Ratings />} />
        <Route exact path="/recipe" element={<Recipe />} />
        <Route exact path="/recipe-list" element={<RecipeList recipes={recipes} />} />
        <Route path="*" element={<NotFound />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
